import classes from "./styles/card.module.css"


function Card(props) {
    return (
        <div className={classes.Card}>
            <section className={classes.texto}>
                <h2>{props.title}</h2>
                <p className={classes["small-text"]}>{props.date}</p>
                <p>{props.text}</p>
            </section> 
        </div>
    );
}

export default Card;
